import React,{ Component } from 'react'
import {Link} from 'react-router-dom';
import image3 from '../images/image3.jpg'
class Meditationex extends Component {
  render() {
      return (
       <div style={ImgDiv}>       <div className= 'float center text-center pb-5'>
        <h3 >WHAT IS IN YOUR MIND</h3>
        </div>
       <div className= 'row'>
       <div className='col text-center pt-5 border '>
         <button>Meditation</button>
       </div>
       <div className='col text-center pt-5 border pb-5'>
         <button>Exercise</button>
       </div>
       </div>

       
        
        
        </div>



      )
  }  
}
const ImgDiv={
  backgroundImage: 'url('+image3+')',
  backgroundSize: "cover",
  backgroundAttachment: "fixed",
  height:"600px",
}

export default Meditationex;
